import React from "react";
import { HiOutlineMail } from "react-icons/hi";
import { FaWhatsapp } from "react-icons/fa";
import { FaInstagram } from "react-icons/fa";

export default function Contact() {
  return (
    <div className="whoAreBox">
      {/* <h1 className="hoverTitle">Quienes Somos</h1> */}
      <ul className="ulContact">
        <div className="icons">
          <HiOutlineMail />
          <li className="hoverText"> sasky.softwarecompany@gmail.com</li>
        </div>
        <div>
          <FaWhatsapp />
          <li className="hoverText"> +54 2984391081 </li>
        </div>
        <div>
          <FaInstagram />
          <li className="hoverText"> instagram</li>
        </div>
      </ul>
    </div>
  );
}
